offset-x\uFF1A\u957F\u5EA6\u503C\uFF0C\u6307\u5B9A\u5143\u7D20\u548C\u6295\u5F71\u4E4B\u95F4\u7684\u6C34\u5E73\u8DDD\u79BB\u3002\u6B63\u503C\u5C06\u9634\u5F71\u7F6E\u4E8E\u5143\u7D20\u53F3\u4FA7\uFF0C\u8D1F\u503C\u5C06\u9634\u5F71\u7F6E\u4E8E\u5DE6\u4FA7\u3002
<br>
offset-y\uFF1A\u957F\u5EA6\u503C\uFF0C\u6307\u5B9A\u5143\u7D20\u548C\u6295\u5F71\u4E4B\u95F4\u7684\u5782\u76F4\u8DDD\u79BB\u3002\u6B63\u503C\u5C06\u9634\u5F71\u7F6E\u4E8E\u5143\u7D20\u4E0B\u65B9\uFF0C\u8D1F\u503C\u5C06\u9634\u5F71\u7F6E\u4E8E\u5176\u4E0A\u65B9\u3002
